import React, { Component } from "react";
import { Link } from 'react-router-dom';

function FrontScreen() {
    return (
        <div className="front-div">


            <div>

                <video autoPlay loop muted plays-inline style={{zIndex: "-1", objectFit: "contain", width: "100%", minHeight: "100%", position: "absolute"}}> 

                    <source src="videos/video.mp4" type="video/mp4" /> 
                </video>

            </div>
            <div className = "title-words">
                <h1> Insurance </h1> 
                <h3> Simplified. </h3>
                <p> No More Confusing SHIP</p>
                <a href="/about"> Explore </a> 
                <h1> <Link maintainScrollPosition={false} to={{
                    pathname: '/components/OpenApi',
                    state: {fromDashboard: false},
                }}> Go to OpenApi page</Link>  </h1>
            </div>


    </div>
    )
}
export default FrontScreen;
